def convert_base64_to_string(base64_string):
    try:
        # Giải mã chuỗi Base64 thành dữ liệu byte
        byte_data = base64.b64decode(base64_string)

        # Chuyển đổi byte thành chuỗi với encoding UTF-8
        decoded_string = byte_data.decode('utf-8')

        return decoded_string

    except (base64.binascii.Error, UnicodeDecodeError) as e:
        # Quăng ngoại lệ nếu có lỗi trong quá trình giải mã hoặc chuyển đổi
        raise ValueError("")


for i in ans:
    # Ví dụ chuỗi Base64 hợp lệ
    try:
        base64_string = i
        result = convert_base64_to_string(base64_string)
        print(f"case: {result}")
    except ValueError as e:
        print(e)

